import React from 'react';
import { motion } from 'framer-motion';
import AnimateOnScreen from '../../AnimateOnScreen';
import {
  ContentSection,
  Wrap,
  Title,
  Paragraph
} from './styles';

const TermsAndConditions = () => {
  return (
    <ContentSection>
      <AnimateOnScreen>
        <Wrap>
          <Title>Terms and Conditions</Title>
          <Paragraph>
            Welcome to our website. These terms and conditions outline the rules and regulations for the use of our website.
          </Paragraph>
          <Paragraph>
            By accessing this website, we assume you accept these terms and conditions in full. Do not continue to use our website if you do not accept all of the terms and conditions stated on this page.
          </Paragraph>
          <Title>Intellectual Property</Title>
          <Paragraph>
            Unless otherwise stated, we own the intellectual property rights for all material on our website. All intellectual property rights are reserved.
          </Paragraph>
          <Title>User Agreement</Title>
          <Paragraph>
            You are not permitted to use the website for any illegal or unauthorized purpose. You agree to comply with all applicable laws and regulations.
          </Paragraph>
          <Title>Limitations of Liability</Title>
          <Paragraph>
            In no event shall we be liable for any direct, indirect, incidental, or consequential damages arising out of or in any way connected with your use of the website.
          </Paragraph>
          <Title>Modifications</Title>
          <Paragraph>
            We may revise these terms from time to time. The revised terms will apply to the use of our website from the date of the publication of the revised terms on our website.
          </Paragraph>
        </Wrap>
      </AnimateOnScreen>
    </ContentSection>
  );
};

export default React.memo(TermsAndConditions);
